import Head from "next/head";
import Link from 'next/link'

const Layout = (props) => {
  return (
    <div>
      <Head>
        <title>Portfolio</title>
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        <meta charSet="utf-8" />
        <link href="https://fonts.googleapis.com/css?family=Nunito:400,400i,700,700i&display=swap" rel="stylesheet" />
      </Head>
      <nav>
        <div className='logo'>
          <img className='headshot' src='/headshot.jpg' />
          <div className='personal-info-container'>
            <div className='personal-info name'>
              Noah Maizels
            </div>
            <div className='personal-info job-title'>
              Web Developer
            </div>
          </div>
        </div>
        <div className='links'>
          <Link href="/index">
            <a>Home</a>
          </Link>
          <Link href="/projects">
            <a>Projects</a>
          </Link>
          <Link href="/contact">
            <a>Projects</a>
          </Link>
        </div>
      </nav>

      {/* <Header appTitle={appTitle} /> */}
        <div className="Content">{props.children}</div>
      {/* <NavBar navButtons={navButtons} /> */}
    <style jsx>{`
      .links {
        display: flex;

      }
      nav {
        display: flex;
        justify-content: space-between;
      }
      .logo {
        display: flex;
        align-items: flex-end;
      }
      .headshot {
        width: 50px;
        border-radius: 100%;
      }
      .personal-info-container{
        display: inline-block;
        margin-left: 15px;

      }
      .personal-info {
        line-height: 1rem;
      }
      .job-title {
        margin-top: 5px;
        color: #CCCCCC;
      }

    `}</style>
    </div>
  )
}

export default Layout
